        <script>
            var Lipsum = "";
            var Lipsum2="101824";

            window.onload = function () {
                function resizeRight(){
                    d3.select("#train-vs-test")
                        .style("width", d3.select("#right").node().clientWidth + "px")
                    ;
                }

                resizeRight();

                d3.select(window)
                    .on("resize", function(){ resizeRight() })
                ;


                /**
                 * 
                 *  section 
                */
                d3.select("#training-section")
                    .selectAll("p")
                    .data(d3.range(1, 10))
                    .enter()
                    .append("p")
                    .text(Lipsum)
                ;

                d3.select("#testing-section")
                    .selectAll("p")
                    .data(d3.range(1, 2))
                    .enter()
                    .append("p")
                    .text(Lipsum2)
                ;
				
				d3.select("#training-section")
                    .selectAll("img")
					.data(d3.range(1, 2))
					.enter()
					.append("img")
					.attr("src", function(d){ return "media/" + d + ".jpg"})
                    .style('height', '350px')
                    .style('width', '350px')
                ;

                d3.select("#testing-section")
                    .selectAll("img")
					.data(d3.range(2, 3))
					.enter()
					.append("img")
					.attr("src", function(d){ return "media/" + d + ".jpg"})
                    .style('height', '350px')
                    .style('width', '350px')
                ;
				
				

                var bdt = new BinaryDecisionTree({
                    el: "#train-vs-test",
                    trainingSection: "#training-section",
                    testSection: "#testing-section",
                    
					/**
                     * 
                     *  paramater  false
                     * 
                    */
                    //flood: false
                });

                bdt.setDataFromJson("./dataset.json", function(){
                    bdt.install();
                    bdt.play();
                })
